    'VariableNames',     {'run',    'AoA',    'AoS',    'dPb',    'pBar',    'pInf',    'temp',    'nu',    'rpmWT',    'rho',    'q',    'V',    'Re',    'FX',    'FY',    'FZ',    'MX',    'MY',    'MZ',    'CFX',    'CFY',    'CFZ',    'CN',    'CT',    'CY',    'CL',    'CD',    'CYaw',    'CMroll',    'CMpitch',    'CMpitch25c',    'CMyaw'});
